import RecipeForm from './Components/recipeform.js';


function App() {
  return (
    <div className="App">
      Grandma's Recipes
      <Dashboard />
      <RecipeCard />
      <RecipeForm />
      <Login />
      <Signup />
    </div>
  );
}

export default App;
